import React, { useState } from "react";
import "./HomePage.css";

export default function HomePage() {
  const [file, setFile] = useState(null);
  const [error, setError] = useState("");

  const handleFileChange = (e) => {
    const selectedFile = e.target.files[0];
    if (selectedFile && selectedFile.size > 1024 * 1024 * 1024) { // 1GB limit
      setError("File size exceeds 1GB. Please upload a smaller file.");
      setFile(null);
    } else {
      setFile(selectedFile);
      setError("");
    }
  };

  const handleUpload = () => {
    if (file) {
      // Implement upload logic here
      console.log("Uploading file:", file);
      alert("File uploaded successfully!");
    } else {
      alert("Please select a file first.");
    }
  };

  return (
    <div className="container">
      <div className="card-container">
        <div className="card">
          <div className="text-center mb-6">
            <h1 className="title">Upload Your File</h1>
            <p className="description">Maximum file size: 1GB</p>
          </div>
          <div className="form-container">
            <input
              type="file"
              onChange={handleFileChange}
              className="file-input"
            />
            {error && <p className="error-message">{error}</p>}
            <button
              onClick={handleUpload}
              disabled={!file}
              className="upload-button"
            >
              Upload File
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
